n for KL Rahul. India were bidding for their 10th successive bilateral ODI series win, with 2019 World Cup hosts England looking to treat Tuesday\'s match as the kind of winner-takes-all knockout match they will hope to play during next year\'s global showpiece event.'),(1233,280,'_news_detail','field_5b4ddaeaab339'),(1234,280,'news_sources','NDTV Sports'),(1235,280,'_news_sources','field_5b4ddd664de9e'),(1236,280,'news_channel','NDTV'),(1237,280,'_news_channel','field_5b4dddb44de9f'),(1238,280,'news_consequences','No'),(1239,280,'_news_consequences','field_5b4ddf2178c9d'),(1240,280,'news_writer','NDTV Writer A'),(1241,280,'_news_writer','field_5b4de1d109cee'),(1242,280,'news_editor','NDTV Editor A'),(1243,280,'_news_editor','field_5b4de1fd09cef'),(1244,281,'news_timeline','India vs England, Live Score 3rd ODI: Dhawan, Kohli Steady India After Rohit\'s Departure'),(1245,281,'_news_timeline','field_5b4ddb37ab33a'),(1246,281,'news_detail','England captain Eoin Morgan won the toss and elected to field in the third and deciding one-day international against India at Headingley on Tuesday. England made one change to the side that won the second ODI by 86 runs on Saturday, with Hampshire batsman James Vince replacing Jason Roy after the opener suffered a finger injury while fielding at Lord\'s. India made three changes with paceman Bhuvneshwar Kumar fit following a back injury. Bhuvneshwar and Shardul Thakur replaced fellow seamers Umesh Yadav and Siddarth Kaul, with batsman Dinesh Karthik coming in for KL Rahul. India were bidding for their 10th successive bilateral ODI series win, with 2019 World Cup hosts England looking to treat Tuesday\'s match as the kind of winner-takes-all knockout match they will hope to play during next year\'s global showpiece event.'),(1247,281,'_news_detail','field_5b4ddaeaab339'),(1248,281,'news_sources','NDTV Sports'),(1249,281,'_news_sources','field_5b4ddd664de9e'),(1250,281,'news_channel','NDTV'),(1251,281,'_news_channel','field_5b4dddb44