INSERT INTO `wp_posts` VALUES (2,1,'2018-07-03 09:32:36','2018-07-03 09:32:36','<h3 style=\"text-align: justify;\">Welcome to my Page</h3>\r\n<h5>This page developed in WordPress 4.9 by Mehboob Shaikh</h5>\r\n&nbsp;\r\n<h3 style=\"padding-left: 30px;\"><strong>First Quote -</strong></h3>\r\n<blockquote>\r\n<p style=\"padding-left: 60px; text-align: justify;\"><span style=\"font-size: 16px;\">Hi there! I\'m Mehboob you an call me SMS, I\'m Full Stack Web Developer, and this is my first blog in WordPress. I live in Thane, and I like travelling.</span></p>\r\n</blockquote>','Introduction','','publish','closed','open','','introduction','','','2018-08-16 06:54:23','2018-08-16 06:54:23','',0,'http://localhost/WP/wordpress/?page_id=2',1,'page','',0),(16,1,'2018-07-03 10:40:18','2018-07-03 10:40:18','','Swift Icon','','inherit','open','closed','','swift','','','2018-07-03 10:40:47','2018-07-03 10:40:47','',0,'http://localhost/WP/wordpress/wp-content/uploads/2018/07/swift.png',0,'attachment','image/png',0),(29,1,'2018-07-03 12:37:49','2018-07-03 12:37:49','Thane City','Thane City','Thane City','inherit','open','closed','','thane','','','2018-07-03 12:38:27','2018-07-03 12:38:27','',0,'http://localhost/WP/wordpress/wp-content/uploads/2018/07/thane.png',0,'attachment','image/png',0),(30,1,'2018-07-03 12:47:44','2018-07-03 12:47:44','Thane city is situated in Mumbai.\r\n\r\n<em><a href=\"http://localhost/WP/wordpress/wp-content/uploads/2018/07/thane-1.png\"><img class=\"alignnone wp-image-120\" src=\"http://localhost/WP/wordpress/wp-content/uploads/2018/07/thane-1.png\" alt=\"Thane City\" width=\"170\" height=\"119\" /></a></em>\r\n\r\n<em>Thane</em>, colloquially called Thana, is a metropolitan city in India. <em>Thane</em> city coincides entirely with <em>Thane</em>taluka, one of the seven talukas of <em>Thane</em> district','Thane','','publish','open','open','','thane','','','2018-07-06 09:37:19','2018-07-06 09:37:19','',0,'http://localhost/WP/wordpress/?p=30',0,'post','',0)